    false,nt"url": null,nt"notes": "NODC Accession 0115597 includes biological,
    chemical, discrete sample, physical and profile data collected from RYOFU MARU in
    the East China Sea (Tung Hai), North Pacific Ocean and Philippine Sea from 1997-06-23
    to 1997-07-22 and retrieved during cruise PACIFICA_49RY19970623. These data include
    ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
    CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON,
    DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION),
    NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY, SIGMA-THETA,
    SILICATE, TOTAL PHOSPHORUS, WATER TEMPERATURE and pH. The instruments used to collect
    these data include CTD and bottle. These data were collected by Naoshi Kubo of Japan
    Meteorological Agency and Masao Ishii of Meteorological Research Institute; Geochemical
    Research Department as part of the PACIFICA_49RY19970623 data set.nnPACIFICA (PACIFic
    ocean Interior CArbon) was an international collaborative project for the data synthesis
    of ocean interior carbon and its related parameters in the Pacific Ocean. The North
